tPrioridadID\\r\\nLEFT JOIN mailing\\r\\nON avisoticket.MailingID\\t= mailing.MailingID\\r\\nLEFT JOIN direccion \\r\\nON avisoticket.DireccionID = direccion.DireccionID\\r\\nLEFT JOIN avisoticketelemento\\r\\nON avisoticket.AvisoTicketID = avisoticketelemento.AvisoTicketID\\r\\nLEFT JOIN elemento \\r\\nON avisoticketelemento.ElementoID = elemento.ElementoID\\r\\nLEFT JOIN tablageneral TipoEquipo\\r\\nON tipoequipo.tablageneralid =  elemento.TipoEquipoID\\r\\nLEFT JOIN avisoticketplanificacion\\r\\nON avisoticket.AvisoTicketID= avisoticketplanificacion.AvisoTicketID \\r\\nLEFT JOIN usuario\\r\\nON usuario.UsuarioID  = proyecto_of.UsuarioIDCierre\\r\\n\\r\\n\\r\\nWHERE proyecto_of.EsObraOf = 'S' AND proyecto_of.CustomerID = 29 \\r\\nAND proyecto_of.Proyecto_OFID = 1798\\r\\n\",\n\t\t\t\"records\":\n\t\t\t[\n\t\t\t\t{\n\t\t\t\t\t\"Numero\":1798,\n\t\t\t\t\t\"Proyecto_OFID\":22,\n\t\t\t\t\t\"FechaIntervencion\":\"20230216\",\n\t\t\t\t\t\"NumeroTicketID\":9,\n\t\t\t\t\t\"NumeroTicketCodigo\":6,\n\t\t\t\t\t\"NumeroTicketNombre\":\"\\r\\n<BODY>qwertyuiasdfghjmkdrtstrsrtsrs<\\/BODY>\",\n\t\t\t\t\t\"UsuarioCreacion\":\"Pruebas\",\n\t\t\t\t\t\"FechaHoraCreacion\":\"2023-02-27T23:13:36.888\",\n\t\t\t\t\t\"PlanificacionIntervencionID\":6,\n\t\t\t\t\t\"PlanificacionIntervencionNombre\":\"Planificaci\\u00f3n del 22\\/02\\/2023 14:50\",\n\t\t\t\t\t\"TiempoPrevisto\":\"6 Horas\",\n\t\t\t\t\t\"UsuarioCierreID\":0,\n\t\t\t\t\t\"nombreUsuarioCierre\":\"\",\n\t\t\t\t\t\"FechaHoraCierre\":\"0000-00-00T00:00:00.000\",\n\t\t\t\t\t\"NAlbaran\":\"\",\n\t\t\t\t\t\"Descripcion\":\"JULLL36NT\",\n\t\t\t\t\t\"ObservacionInterna\":\"JULLL36NT\",\n\t\t\t\t\t\"VehiculoId\":1,\n\t\t\t\t\t\"VehiculoNombre\":\"ARP86F\",\n\t\t\t\t\t\"VehiculoCodigo\":\"BES\",\n\t\t\t\t\t\"ContadorInicial\":10,\n\t\t\t\t\t\"ContadorFinal\":20,\n\t\t\t\t\t\"Kilometros\":\"10\",\n\t\t\t\t\t\"FechaAltaTicket\":\"2023-02-22T14:50:53.265\",\n\t\t\t\t\t\"TipoTicket\":\"Averia\",\n\t\t\t\t\t\"Prioridad\":\"PRUEBALO\",\n\t\t\t